import React from "react";
import "./Main.css";
import logo from "../../assets/images/instagram.png";
import compass from "../../assets//images/compass.png";
import heart from "../../assets//images/heart.png";
import profile from "../../assets//images/user.png";
import StoryUser from "../../components/StoryUser";
import RecommendUser from "../../components/RecommendUser";

const images = [
  {
    id: 1,
    src: "https://cdn-icons-png.flaticon.com/128/1077/1077035.png",
    alt: "heart",
  },
  {
    id: 2,
    src: "https://cdn-icons-png.flaticon.com/128/589/589671.png",
    alt: "chat",
  },
  {
    id: 3,
    src: "https://cdn-icons-png.flaticon.com/128/3580/3580382.png",
    alt: "share",
  },
];

const stroyUsers = [
  {
    id: 1,
    src: "data:image/jpeg;base64,",
    alt: "user1",
  },
  {
    id: 2,
    src: "data:image/jpeg;base64,",
    alt: "user2",
  },
  {
    id: 3,
    src: "data:image/jpeg;base64,",
    alt: "user3",
  },
  {
    id: 4,
    src: "data:image/jpeg;base64,",
    alt: "user4",
  },
];

const recommendUsers = [
  {
    id: 1,
    src: "data:image/jpeg;base64,",
    alt: "user1",
  },
  {
    id: 2,
    src: "data:image/jpeg;base64,",
    alt: "user2",
  },
  {
    id: 3,
    src: "data:image/jpeg;base64,",
    alt: "user3",
  },
];

const Main = () => {
  return (
    <div className="main">
      <nav className="header">
        <div className="headerContent">
          <div className="logoBox">
            <div className="instagramLogo">
              <img src={logo} alt="로고" />
            </div>
            <div className="divider"></div>
            {/* <div className="title"> */}
            <a className="title" href="/">
              westagram
            </a>
            {/* </div> */}
          </div>
          <div className="searchForm">
            <input className="searchInput" type="text" placeholder="검색" />
            <i className="searchIcon"></i>
          </div>
          <div className="userMenu">
            <img src={compass} alt="나침반" />
            <img src={heart} alt="하트" />
            <img src={profile} alt="프로필" />
          </div>
        </div>
      </nav>

      <main>
        <div className="mainContentBox">


          <div className="main-right">
            <div className="myProfile">
              <img
                src="data:image/jpeg;base64,"
                alt=""
              />
              <div className="myProfileText">
                <p>wecode_bootcamp</p>
                <p>Wecode | 위코드</p>
              </div>
            </div>

            <div className="story">
              <div className="storyHeader">
                <p className="storyTitle">스토리</p>
                <p className="all">모두 보기</p>
              </div>
              <div className="storyContent">
                {stroyUsers.map((el) => (
                  <StoryUser />
                ))}
              </div>
            </div>

            <div className="recommend">
              <div className="recommendHeader">
                <p className="recommendTitle">회원님을 위한 추천</p>
                <p className="all">모두 보기</p>
              </div>
              <div className="recommendContent">
                {recommendUsers.map((el) => (
                  <RecommendUser />
                ))}
              </div>
            </div>

            <div className="info">
              <p>
                Instagram 정보 · 지원 · 홍보 센터 · API · <br /> 채용 정보 ·
                개인정보처리방침 · 약관 · <br /> 디렉터리 · 프로필 · 해시태그 ·
                언어
              </p>
              <p>© 2023 Instagram from Meta</p>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Main;
